import React from 'react';
import styled from 'styled-components';

const History = ({ userData, repos, setUserState }) => {
    console.log(userData.login);
    // const idSet = new Set();
    // idSet.add(userData.login);
    localStorage.setItem([userData.login], JSON.stringify(userData));
    // console.log(localStorage.key());
    // localStorage.id
    // console.log(idSet);
    for (let i = 0; i < localStorage.length; i++) {
        <div>{localStorage.key(i)}</div>;
    }
    const onHistoryClick = (e) => {
        // console.log(e.target.innerText);
        setUserState(JSON.parse(localStorage[e.target.innerText]));
    };
    const rendering = () => {
        const result = [];
        for (let i = 0; i < localStorage.length; i++) {
            result.push(
                <div className="id" onClick={onHistoryClick}>
                    {localStorage.key(i)}
                </div>
            );
        }
        return result;
    };
    return <Container>{rendering()}</Container>;
};

const Container = styled.section`
    position: fixed;
    top: 40%;
    left: 10px;

    .id {
        cursor: pointer;
    }
`;

export default History;
